//Ver componentes fuertemente conectados
vector <int> dfs_num, dfs_low, S, visited;
int UNVISITED=-1, numSCC, dfsNumberCounter;
void tarjanSCC(int u)
{	
	dfs_low[u] = dfs_num[u] = dfsNumberCounter++; // dfs_low[u] <= dfs_num[u]
	S.push_back(u); // stores u in a vector based on order of visitation
	visited[u] = 1;
	for (int j = 0; j < (int)ListaAdj[u].size(); j++)
	{
		int v = ListaAdj[u][j];
		if (dfs_num[v] == UNVISITED)
			tarjanSCC(v);
		if (visited[v]) // condition for update
		dfs_low[u] = min(dfs_low[u], dfs_low[v]);
	}
	int conta=0;
	vector <int> fuertes;
	if (dfs_low[u] == dfs_num[u])
	{ // if this is a root (start) of an SCC
		++numSCC;
		while (1)
		{
			int v = S.back(); S.pop_back(); visited[v] = 0;
			fuertes.push_back(v+1);
			//printf(" %d", v+1);
			++conta;
			if (u == v) break;
		}

		if (fuertes.size()>1)
		{
			printf("SCC %d:", numSCC); // this part is done after recursion
			printf("  %d\n", conta);
			for (auto punchis: fuertes)
				printf("%d ", punchis);
			printf("\n");
		}

	}
}
