vector <ll> construir(ll i)
{
	vector<ll> tempi, regreso;
	tempi.push_back(0);
	visitados[i]=1;

	int j;
	for (j=-1; ++j<ListaAdj[i].size(); )
	{
		if ( visitados[ListaAdj[i][j]] ) continue;
		regreso=construir( ListaAdj[i][j] );
		regreso[0] += ListaAdjPesos[i][j];
		if ( tempi[0] < regreso[0] )
			tempi=regreso;
	}

	tempi.push_back(i);
	return tempi;
}



